// NavBar.js
import React from 'react';
import Buttons from './buttons';
import Navbar from 'react-bootstrap/Navbar';
import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import { Link } from 'react-router-dom';

const NavBar = ({ login, logout, isAuthenticated }) => {
  return (
    <Navbar expand="lg" className="bg-body-tertiary">
      <Container>
        <Navbar.Brand href="/Welcome">Your Brand Name</Navbar.Brand>
        <Navbar.Toggle aria-controls="basic-navbar-nav" />
        <Navbar.Collapse id="basic-navbar-nav">
          {isAuthenticated && (
            <Nav className="me-auto">
              <Nav.Link><Link to="/Facture">Home</Link></Nav.Link>
              <Nav.Link href="">Link</Nav.Link>
              <Nav.Link href="">Link</Nav.Link>
              {/* Add your additional navigation items here */}
            </Nav>
          )}
        </Navbar.Collapse>
        <Buttons login={login} logout={logout} />
      </Container>
    </Navbar>
  );
};

export default NavBar;
